import React from "react";

import "../css/InserirUtilizador.css"
import { IonPage, IonHeader, IonTitle, IonToolbar, IonContent, IonGrid, IonRow, IonCol } from "@ionic/react";

class InserirUtilizador extends React.Component {


    render() {
        return(

            <IonPage>

                <IonHeader>
                <IonToolbar color="primary">
                    <IonTitle id="page-title">Inserir um novo Utilizador</IonTitle>
                </IonToolbar>
                </IonHeader>

                <IonContent>

                    <IonGrid>

                        <IonRow>

                            <IonCol>

                            <img src={require('../imgs/perfil_pic.png')} width="100%" height="250" alt="Loading..."/> 

                            </IonCol>

                        </IonRow>

                    </IonGrid>

                </IonContent>

            </IonPage>    
        );
    }
}

export default InserirUtilizador;
